import { NavLink } from 'react-router-dom';
import React from 'react';
import '../assets/navbar.css';
import Logo from '../assets/images/genevalogo.svg';
import "react-modal";
import Logo1 from '../assets/images/profile-icon.png';
import ReactModalLogin from "react-modal-login";

const Navbar = () => {

    return (
        <nav className="navbar">
            <div className="container">
                <div className="nav-elements">
                    <ul className="navList">
                        <li>
                            <img src={Logo} className="genLogo" alt="geneva logo" />
                        </li>
                        <li>
                            <NavLink to="/">Home</NavLink>
                        </li>
                        <li>
                            <NavLink to="/events">Events</NavLink>
                        </li>
                        <li>
                            <NavLink to="/trivia">Trivia</NavLink>
                        </li>
                        <li>
                            <NavLink to="/upload">Upload</NavLink>
                        </li>
                        <li>
                            <NavLink to="/reviews">Reviews</NavLink>
                        </li>
                    </ul>
                    <input id="myBtn" className="buttonImg" type="Image" src={Logo1} height="50" width="50" name="Icon"></input>
                    <div id="myModal" class="modal">

                        <div class="modal-content">
                            <span class="close">&times;</span>

                            <h3>Login</h3>
                            <p>Username:</p><input></input>
                            <p>Password:</p><input></input>
                            <button>Login</button>
                            <button>Create Account</button>

                            <NavLink to="/profile">Go To Profile (temporary)</NavLink>
                        </div>

                    </div>

                </div>
            </div>
        </nav >
    )
    
}





export default Navbar

class Sample extends React.Component {
    constructor(props) {
      super(props);
  
      this.state = {
        showModal: false,
        loading: false,
        error: null
      };
    }
  
    openModal() {
      this.setState({
        showModal: true
      });
    }
  
    closeModal() {
      this.setState({
        showModal: false,
        error: null
      });
    }
  
    onLoginSuccess(method, response) {
      console.log("logged successfully with " + method);
    }
  
    onLoginFail(method, response) {
      console.log("logging failed with " + method);
      this.setState({
        error: response
      });
    }
  
    startLoading() {
      this.setState({
        loading: true
      });
    }
  
    finishLoading() {
      this.setState({
        loading: false
      });
    }
  
    afterTabsChange() {
      this.setState({
        error: null
      });
    }
  
    render() {
      return (
        <div>
          <button onClick={() => this.openModal()}>Open Modal</button>
  
          <ReactModalLogin
            visible={this.state.showModal}
            onCloseModal={this.closeModal.bind(this)}
            loading={this.state.loading}
            error={this.state.error}
            tabs={{
              afterChange: this.afterTabsChange.bind(this)
            }}
            loginError={{
              label: "Couldn't sign in, please try again."
            }}
            registerError={{
              label: "Couldn't sign up, please try again."
            }}
            startLoading={this.startLoading.bind(this)}
            finishLoading={this.finishLoading.bind(this)}
          />
        </div>
      );
    }
  }
